import { motion } from 'framer-motion';
import { HashLink } from 'react-router-hash-link'; // Ensure this is installed
import Footer from './components/Footer'; // Importing Footer properly
import { useState, useEffect } from 'react';
import React from 'react';


function App() {
    const [loading, setLoading] = useState(true);
  
    useEffect(() => {
      // Simulate a short loading time
      setTimeout(() => {
        setLoading(false);
      }, 1000); // 1 second
    }, []);
  
    if (loading) {
      return (
        <div className="h-screen flex justify-center items-center bg-dark">
          <motion.h1
            className="text-3xl font-bold text-neon-teal"
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            transition={{ duration: 0.5 }}
          >
            Loading...
          </motion.h1>
        </div>
      );
    }
  
    return (
    <div className="min-h-screen bg-dark">
      {/* Hero Section */}
      <motion.div 
        initial={{ opacity: 0, y: 20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.8 }}
        className="container mx-auto px-4 py-20 text-center"
      >
        {/* Headshot */}
        <picture>
            <source srcset="/headshot.webp" type="image/webp" />
            <motion.img
                src="/headshot.jpg"
                alt="Oshadhi Jayaweera"
                className="w-48 h-48 rounded-full border-4 border-neon-teal mx-auto mb-8 shadow-glow"
                whileHover={{ scale: 1.05 }}
            />
        </picture>


        {/* Headline */}
        <motion.h1 
          className="text-5xl md:text-6xl font-bold mb-6 bg-gradient-to-r from-neon-teal to-soft-magenta bg-clip-text text-transparent"
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ delay: 0.3 }}
        >
          Oshadhi Jayaweera
        </motion.h1>

        {/* Subtitle */}
        <motion.p
          className="text-xl md:text-2xl text-off-white mb-8"
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ delay: 0.6 }}
        >
          MBA Graduate | Marketing Strategist | Business Communication Expert
        </motion.p>

        {/* CTA Button */}
        <HashLink 
          to="/#contact" 
          smooth
          className="bg-neon-teal text-dark px-8 py-3 rounded-lg font-bold text-lg hover:shadow-[0_0_25px_-5px_rgba(0,255,204,0.3)] transition-all"
        >
          Get in Touch
        </HashLink>
      </motion.div>

      {/* Contact Section */}
      <section id="contact" className="min-h-screen pt-24 pb-32">
      <div className="container mx-auto px-4 text-center">
        <motion.div
          initial={{ opacity: 0 }}
          whileInView={{ opacity: 1 }}
          className="max-w-2xl mx-auto"
        >
          <h2 className="text-4xl md:text-5xl font-bold mb-6 bg-gradient-to-r from-neon-teal to-soft-magenta bg-clip-text text-transparent">
            Get in Touch
          </h2>
          <p className="text-xl text-off-white mb-12">
            I'm always open to discussing new projects, creative partnerships, or opportunities.
          </p>
          {/* Social Media Links */}
          <div className="flex justify-center space-x-6 mt-4">
            <a
              href="mailto:your.email@example.com"
              className="text-off-white hover:text-neon-teal"
            >
              <svg
                className="w-6 h-6"
                fill="currentColor"
                viewBox="0 0 24 24"
              >
                <path d="M20 4H4c-1.1 0-2 .9-2 2v12c0 1.1.9 2 2 2h16c1.1 0 2-.9 2-2V6c0-1.1-.9-2-2-2zm0 4l-8 5-8-5V6l8 5 8-5v2z" />
              </svg>
            </a>
            <a
              href="https://www.linkedin.com/in/oshadhi-jayaweera/"
              target="_blank"
              rel="noopener noreferrer"
              className="text-off-white hover:text-neon-teal"
            >
              <svg
                className="w-6 h-6"
                fill="currentColor"
                viewBox="0 0 24 24"
              >
                <path d="M19 0h-14c-2.761 0-5 2.239-5 5v14c0 2.761 2.239 5 5 5h14c2.762 0 5-2.239 5-5v-14c0-2.761-2.238-5-5-5zm-11 19h-3v-11h3v11zm-1.5-12.268c-.966 0-1.75-.79-1.75-1.764s.784-1.764 1.75-1.764 1.75.79 1.75 1.764-.783 1.764-1.75 1.764zm13.5 12.268h-3v-5.604c0-3.368-4-3.113-4 0v5.604h-3v-11h3v1.765c1.396-2.586 7-2.777 7 2.476v6.759z" />
              </svg>
            </a>
          </div>
        </motion.div>
      </div>
    </section>

      {/* Footer Component */}
      <Footer />
    </div>
  );
}

export default App;
